         | `Nonconforming_response of string * string option
         | `Unparseable_response of
           string * ((int * int) * (int * int)) option ] )
       result
       thread

  val bind : 'a thread -> ('a -> 'b thread) -> 'b thread

  val return : 'c -> 'c thread
end)
