      <p>If you dont want to prorate, set the <code>proration_behavior</code> option to <code>none</code>. With this option, the customer is billed <currency>100</currency> on May 1 and <currency>200</currency> on June 1. Similarly, if you set <code>proration_behavior</code> to <code>none</code> when switching between different billing intervals (for example, from monthly to yearly), we dont generate any credits for the old subscriptions unused time. We still reset the billing date and bill immediately for the new subscription.</p>
      
