      To preview how the proration is calculated, use the <a href="/docs/api/invoices/upcoming">upcoming invoice</a> endpoint.</p>
      
      <p>By default, we prorate subscription changes. For example, if a customer signs up on May 1 for a <currency>100</currency> price, theyll be billed <currency>100</currency> immediately. If on May 15 they switch to a <currency>200</currency> price, then on June 1 theyll be billed <currency>250</currency> (<currency>200</currency> for a renewal of her subscription, plus a <currency>50</currency> prorating adjustment for half of the previous months <currency>100</currency> difference). Similarly, a downgrade generates a credit that is applied to the next invoice. We also prorate when you make quantity changes.</p>
      
      <p>Switching prices does not normally change the billing date or generate an immediate charge unless:</p>
      
      <ul>
      <li>The billing interval is changed (for example, from monthly to yearly).</li>
      <li>The subscription moves from free to paid, or paid to free.</li>
      <li>A trial starts or ends.</li>
      </ul>
      
      <p>In these cases, we apply a credit for the unused time on the previous price, immediately charge the customer using the new price, and reset the billing date.</p>
      
      <p>If you want to charge for an upgrade immediately, pass <code>proration_behavior</code> as <code>always_invoice</code> to create prorations, automatically invoice the customer for those proration adjustments, and attempt to collect payment. If you pass <code>create_prorations</code>, the prorations are created but not automatically invoiced. If you want to bill the customer for the prorations before the subscriptions renewal date, you need to manually <a href="/docs/api/invoices/create">invoice the customer</a>.</p>
      
      <p>If you dont want to prorate, set the <code>proration_behavior</code> option to <code>none</code>. With this option, the customer is billed <currency>100</currency> on May 1 and <currency>200</currency> on June 1. Similarly, if you set <code>proration_behavior</code> to <code>none</code> when switching between different billing intervals (for example, from monthly to yearly), we dont generate any credits for the old subscriptions unused time. We still reset the billing date and bill immediately for the new subscription.</p>
      
